import { useEffect } from 'react';
import { Button } from 'react-bootstrap';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import { Link, Outlet, useNavigate } from 'react-router-dom';
import { useFetchStudentsQuery } from '../studentApi';

function Dashbord() {
    const {data} = useFetchStudentsQuery()
    console.log(data);
    let isLogin = { islogin: true }
    const navigate = useNavigate()
    useEffect(() => {
        if (isLogin.islogin) {
        }
        else {
            navigate('/login')
            return
        }
    }, [isLogin.islogin])
    return (
        <>
        {
            data.data && <><Navbar bg="dark" variant="dark">
                <Container>
                    <Link to='/dashbord'>Dashbord</Link>
                    <Nav className="me-auto">
                        <Link to='/dashbord/students' className='mx-5 '>Students</Link>
                        <Link to='/dashbord/contactCreate'>Create-Contact</Link>
                    </Nav>
                    <Button variant="success" >LogOut</Button>
                </Container>
            </Navbar>
                <Outlet></Outlet> </>
        }

        </>
    );
}

export default Dashbord;
